//grafico de consumo de materia prima
var handleDashboardSparkline = function() {
    "use strict";

    function t() {
        e.type = "line";
        e.height = "23px";
        e.lineColor = red;
        e.highlightLineColor = red;
        e.highlightSpotColor = red;
        var n = $("#sparkline-cemento").width();
        if (n >= 200) {
            e.width = "200px"
        } else {
            e.width = "100%"
        }
        $("#sparkline-cemento").sparkline(consumoCemento, e);
        e.lineColor = orange;
        e.highlightLineColor = orange;
        e.highlightSpotColor = orange;
        $("#sparkline-arena").sparkline(consumoArena, e);
        e.lineColor = green;
        e.highlightLineColor = green;
        e.highlightSpotColor = green;
        $("#sparkline-binder").sparkline(consumoBinder, e);
        e.lineColor = blue;
        e.highlightLineColor = blue;
        e.highlightSpotColor = blue;
        $("#sparkline-acelerante").sparkline(consumoAcelerante, e);
        e.lineColor = grey;
        e.highlightLineColor = grey;
        e.highlightSpotColor = grey;
        $("#sparkline-plastificante").sparkline(consumoPlastificante, e);
        e.lineColor = dark;
        e.highlightLineColor = dark;
        e.highlightSpotColor = dark;
        $("#sparkline-ceniza").sparkline(consumoCeniza, e)
    }
    var e = {
        height: "50px",
        width: "100%",
        fillColor: "transparent",
        lineWidth: 2,
        spotRadius: "4",
        highlightLineColor: blue,
        highlightSpotColor: blue,
        spotColor: false,
        minSpotColor: false,
        maxSpotColor: false
    };
    t();
    $(window).on("resize", function() {
        $("#sparkline-cemento").empty();
        $("#sparkline-arena").empty();
        $("#sparkline-binder").empty();
        $("#sparkline-acelerante").empty();
        $("#sparkline-plastificante").empty();
        $("#sparkline-ceniza").empty();
        t()
    })
};

